import React from 'react';
import SearchBar from './SearchBar';

function Jumbotron() {
  return (
    <div className='jumbotron bg-primary text-white text-center no-border-radius mb-auto'>
      <a href='/'><img src="https://cdn.appzaib.com/public/wixware/img/logo-185x50-light.png" alt="Wixware Logo"/></a>
      <div className='row'>
        <div className='col-6 offset-md-3 mt-5'>
          <SearchBar />
        </div>
      </div>
    </div>
  );
}

export default Jumbotron;
